import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { ThemeContext } from './ThemeContext';
import Home from './screens/Home';
import Vue2 from './screens/Vue2';
import Bar from './screens/Bar';
import Homard from './screens/Homard';
import St_Jacques from './screens/St_Jacques';
import Tourteau from './screens/Tourteau';
import Vue4 from './screens/Vue4';
import Background from './components/background';


const Stack = createStackNavigator();

export default class App extends React.Component {
 
  constructor(props){
    super(props)
    this.state= { friends: ["Toto", "Tati", "Tonton"]}
  }

  render() {
    return(
      <ThemeContext.Provider>
        <NavigationContainer>
          <Stack.Navigator>
              <Stack.Screen 
                    name="Home"
                    component={Home}
                  />
                <Stack.Screen 
                name="Bar"
                component={Bar}
              /> 
              <Stack.Screen 
                name="Homard"
                component={Homard}
              />
              <Stack.Screen 
                name="St_Jacques"
                component={St_Jacques}
              />
              <Stack.Screen 
                name="Tourteau"
                component={Tourteau}
              />
              <Stack.Screen 
                name="Vue4"
                component={Vue4}
              />
              <Stack.Screen
                name ="Vue2"
                component={Vue2}
              />
          </Stack.Navigator>
        </NavigationContainer>
      </ThemeContext.Provider>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
